{"title":"Flight Itinerary Work In Progress","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega/v3.0.json
  config: {
    kibana: {type: "map", latitude: 10, longitude: -10, zoom: 2}
  }
  data: [
    {
      name: flight_nodes
      url: {
        index: flightpax
        %context%: true
        %timefield%: @timestamp
        body: {
          size: 0
          aggs: {
            flight_legs_lines: {
              terms: {field: "flightId", size: 100}
              aggs: {
                lines: {
                  top_hits: {
                    size: 1
                    _source: {
                      includes: [
                        flight_legs.leg_number
                        flight_legs.origin_coordination
                        flight_legs.destination_coordination
                        flight_legs.destination
                        flight_legs.origin
                        flight_nodes.id
                        flight_nodes.lat
                        flight_nodes.lon
                        flight_edges.from
                        flight_edges.to
                        flight_edges.leg_number
                      ]
                    }
                  }
                }
              }
            }
          }
        }
      }
      format: {
        property: aggregations.flight_legs_lines.buckets[1].lines.hits.hits[0]._source.flight_nodes
      }
    }
    {
      name: flight_edges
      url: {
        index: flightpax
        body: {
          size: 0
          aggs: {
            flight_legs_lines: {
              terms: {field: "flightId", size: 100}
              aggs: {
                lines: {
                  top_hits: {
                    size: 1
                    _source: {
                      includes: [
                        flight_legs.leg_number
                        flight_legs.origin_coordination
                        flight_legs.destination_coordination
                        flight_legs.destination
                        flight_legs.origin
                        flight_nodes.id
                        flight_nodes.lat
                        flight_nodes.lon
                        flight_edges.from
                        flight_edges.to
                        flight_edges.leg_number
                      ]
                    }
                  }
                }
              }
            }
          }
        }
      }
      format: {
        property: aggregations.flight_legs_lines.buckets[1].lines.hits.hits[0]._source.flight_edges
      }
    }
    {
      name: nodes
      source: flight_nodes
      transform: [
        {
          type: geopoint
          projection: projection
          fields: ["lon", "lat"]
        }
      ]
    }
    {
      name: edges
      source: flight_edges
      transform: [
        {
          type: lookup
          from: nodes
          key: id
          fields: ["from", "to"]
          as: ["source", "target"]
        }
        {
          type: linkpath
          sourceX: source.x
          sourceY: source.y
          targetX: target.x
          targetY: target.y
          orient: {signal: "orient"}
          shape: {signal: "shape"}
        }
      ]
    }
  ]
  marks: [
    {
      type: path
      from: {data: "edges"}
      encode: {
        update: {
          stroke: {value: "brown"}
          strokeWidth: {value: 3}
          path: {field: "path"}
          tooltip: {
            signal: "{title: 'Flight from ' + datum.from + ' to ' + datum.to, Flight:datum.from + ' to ' + datum.to, Leg_number: datum.leg_number}"
          }
        }
      }
    }
    {
      name: node
      type: symbol
      from: {data: "nodes"}
      encode: {
        update: {
          stroke: {value: "brown"}
          fill: {value: "brown"}
          strokeWidth: {value: 16}
          shape: {value: "circle"}
          xc: {signal: "datum.x"}
          yc: {signal: "datum.y"}
          tooltip: {signal: "{title: datum.id }"}
        }
      }
    }
    {
      type: text
      from: {data: "nodes"}
      encode: {
        update: {
          text: {field: "id"}
          align: {value: "center"}
          fontSize: {value: "10"}
          fontWieght: {value: "bold"}
          fill: {value: "white"}
          stroke: {value: "white"}
          xc: {signal: "datum.x"}
          yc: {signal: "datum.y"}
          zindex: {value: 1}
        }
      }
    }
  ]
  signals: [
    {
      name: orient
      value: "vertical" // bind: {      //   input: select      //   options: ["vertical", "horizontal", "radial"]      // }
    }
    {
      name: shape
      value: "diagonal" // bind: {      //   input: select      //   options: ["line", "arc", "curve", "diagonal", "orthogonal"]      // }
    }
  ]
}"},"aggs":[]}

